import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import Demo from "./table";

ReactDOM.render(
  <React.StrictMode>
    <App />
    <Demo />
  </React.StrictMode>,
  document.getElementById('root')
);



//ReactDOM.render(<Demo />, document.querySelector("#root"));

